import React from 'react'
import Nav from './navbar'
export default class Information extends React.Component{
    render(){
        return(
            <div>
                <Nav>
                <p>BANGKOK: Thailand plans to allocate more than US$251 million for monarchy "security" in the 2020 budget, according to government figures seen by AFP this week, a hike of more than 13 per cent year-on-year.
Read more at https://www.channelnewsasia.com/news/asia/thailand-seeks-us-251-million-for-palace-budget-a-13-hike-11877400</p>
                </Nav>
            </div>
        )
    }
}
